import CityInput from "./CityInput"

import '../css/App.css';


function App() {
  const [city,setCity] = setState("");

  function handleCityInput(e){
    setCity(e.value)
  }

  return (
    <>
      <CityInput
        city={city}
        handleCityInput={handleCityInput}
      />

    </>
  );
}

export default App;
